// src/pages/Jobs/JobListingPage.js
import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';

const JobListingPage = () => {
  const [jobs, setJobs] = useState([]);
  const [filter, setFilter] = useState('');

  useEffect(() => {
    // Example data
    setJobs([
      { id: 1, title: 'Frontend Developer Intern', company: 'TechStart Inc.', location: 'San Francisco', type: 'Internship' },
      { id: 2, title: 'Data Science Intern', company: 'Analytics Pro', location: 'New York', type: 'Internship' },
      { id: 3, title: 'UX/UI Design Intern', company: 'Creative Solutions', location: 'Remote', type: 'Internship' },
    ]);
  }, []);

  const filteredJobs = jobs.filter((job) =>
    job.title.toLowerCase().includes(filter.toLowerCase()) ||
    job.company.toLowerCase().includes(filter.toLowerCase())
  );

  return (
    <div className="job-listing-container container">
      {/* Filters */}
      <aside className="filters">
        <h3>Filters</h3>
        <input
          type="text"
          placeholder="Search by keyword"
          style={{ width: '100%', marginBottom: '1rem' }}
          value={filter}
          onChange={(e) => setFilter(e.target.value)}
        />
        <div style={{ marginBottom: '1rem' }}>
          <h4>Job Type</h4>
          <label>
            <input type="checkbox" /> Internship
          </label>
          <br />
          <label>
            <input type="checkbox" /> Part-time
          </label>
          <br />
          <label>
            <input type="checkbox" /> Full-time
          </label>
        </div>
        <div style={{ marginBottom: '1rem' }}>
          <h4>Location</h4>
          <label>
            <input type="checkbox" /> Remote
          </label>
          <br />
          <label>
            <input type="checkbox" /> Hybrid
          </label>
          <br />
          <label>
            <input type="checkbox" /> On-site
          </label>
        </div>
      </aside>

      {/* Jobs */}
      <section className="jobs-section">
        <div className="jobs-header">
          <p>Showing {filteredJobs.length} results</p>
          <select>
            <option>Most Recent</option>
            <option>Highest Paying</option>
            <option>Location</option>
          </select>
        </div>
        {filteredJobs.map((job) => (
          <div key={job.id} className="job-card">
            <h3>{job.title}</h3>
            <p>{job.company} | {job.location}</p>
            <Link to={`/jobs/${job.id}`} className="btn btn-primary" style={{ marginTop: '0.5rem' }}>
              Apply Now
            </Link>
          </div>
        ))}
      </section>
    </div>
  );
};

export default JobListingPage;
